--
-- creature_initial_equip
--

--
-- creature_spawns (only for spawns on map 0 and 1)
--
UPDATE `creature_spawns` cs, `creature_initial_equip` cip
SET cs.slot1item = cip.itemslot_1, cs.slot2item = cip.itemslot_2, cs.slot3item = cip.itemslot_3
WHERE cs.entry = cip.creature_entry AND cs.map <= 1;

--
-- event_creature_spawns
--
UPDATE `event_creature_spawns` cs, `creature_initial_equip` cip
SET cs.slot1item = cip.itemslot_1, cs.slot2item = cip.itemslot_2, cs.slot3item = cip.itemslot_3
WHERE cs.entry = cip.creature_entry;

--
-- Misc updates
--
UPDATE `creature_spawns` SET `mountdisplayid` = 17722, `CanFly` = 1 WHERE `entry` = 51372;

--
-- Update world_db_version
--
UPDATE `world_db_version` SET `LastUpdate` = '2016-12-04_01_creature_equip' WHERE `LastUpdate` = '2016-12-03_01_creature_spawns';
